“Your perspective will either become your prison or your passport.”

•

Wow! A revelation!! A word!!! The way you view life will either lock you up or set you free! Life is constantly giving us lessons and guiding us in our evolution - if we are wise, conscious & humble enough to receive it. I cannot even begin to recount everything I have learned through the process of telling this story both personally & artistically. From the experiences that sparked the idea to the journey of creating the film to the ever expanding blossoming of it’s life in festivals, on screen and beyond (who knows how far we will go!), I am so grateful for the growth and the knowledge! We are ever changing and ever expanding and as we shift, so shall our perspectives because we don’t see things as they are, we see them as we are. That is the really beauty of it all! Keep shifting & becoming! Be limitless!!! And as always, dream on Dreamers!!! 💫

If you’re in the LA area and you want to come see my film, ‘Perspectives’ we have a screening this Saturday, March 4th! For more info & tickets check the links in my bio & stories!!! 💜✨ @perspectivesfilm 

